import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the History navigation menu item to be visible
    await page.waitForSelector('.nav-item[data-page="history"]');

    // Click on the History navigation menu item
    await page.click('.nav-item[data-page="history"]');

    // Take a screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_clicking_history.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_clicking_history.png'));

    // Verify that the History page is displayed by checking for a specific element
    const isHistoryPageVisible = await page.isVisible('h1:has-text("History")'); // Assuming there's an h1 with "History" text
    const extractedData = { isHistoryPageVisible };

    return {
      success: true,
      action: "Clicked on the History navigation menu item to view watch history",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

